  return (
    <div className={`sidebar ${showSidebar ? 'open' : ''}`}>
      <button className="close-button" onClick={toggleSidebar}>{`>`}</button>
      <div className="links-container">
        <h3 className='user-tag'>User</h3>
        <Link to="/">Home</Link>
        <Link to="/history">History</Link>
        <Link to="/new">Grievance</Link>
        <Link to="/login">Logout</Link>
        <h3 className='superadmin-tag'>Superadmin</h3>
        <Link to='/dashboards-a'>Dashboard</Link>
        <Link to='/create-admin'>Create Admin</Link>
        <Link to='/superadmin'>View Admin</Link>
        <Link to='/manage-users'>Manage users</Link>
        <Link to='/Complaint'>Complaint</Link>
        <h3></h3>
      </div>
    </div>
  );
};

export default Sidebar;
